import React, { useState, useEffect } from 'react';
import MainNavBar from './main/MainNavBar';
import AdminNavBar from './admin/AdminNavBar';
import CustomerNavBar from './components/NavBar';
import SellersNavBar from './Sellermenu/Scomponents/SellersNavBar';

export default function App() {
  const [isAdminLoggedIn, setIsAdminLoggedIn] = useState(false);
  const [isCustomerLoggedIn, setIsCustomerLoggedIn] = useState(false);
  const [isSellerLoggedIn, setIsSellerLoggedIn] = useState(false);

  useEffect(() => {
    const adminLoggedIn = localStorage.getItem('isAdminLoggedIn') === 'true';
    const jobSeekerLoggedIn = localStorage.getItem('isJobSeekerLoggedIn') === 'true';
    const recruiterLoggedIn = localStorage.getItem('isRecruiterLoggedIn') === 'true';

    setIsAdminLoggedIn(adminLoggedIn);
    setIsCustomerLoggedIn(jobSeekerLoggedIn);
    setIsSellerLoggedIn(recruiterLoggedIn);
  }, []);

  const onAdminLogin = () => {
    localStorage.setItem('isAdminLoggedIn', 'true');
    setIsAdminLoggedIn(true);
  };

  const onCustomerLogin = () => {
    localStorage.setItem('isJobSeekerLoggedIn', 'true');
    setIsCustomerLoggedIn(true);
  };

  const onSellerLogin = () => {
    localStorage.setItem('isRecruiterLoggedIn', 'true');
    setIsSellerLoggedIn(true);
  };

  return (
    <div className="App">
      <h3 align="center">FOOD DELIVERY</h3>
      {isAdminLoggedIn ? (
        <AdminNavBar />
      ) : isCustomerLoggedIn ? (
        <CustomerNavBar onCustomerLogin={onCustomerLogin} onSellerLogin={onSellerLogin} onAdminLogin={onAdminLogin} />
      ) : isSellerLoggedIn ? (
        <SellersNavBar />
      ) : (
        <MainNavBar onAdminLogin={onAdminLogin} onCustomerLogin={onCustomerLogin} onSellerLogin={onSellerLogin} />
      )}
    </div>
  );
}
